(()=>{eval("((location, projectPages) => {\n    const repo = projectPages ? '/' + location.pathname.split('/')[1] : '';\n    const redirect = () => {\n        location.replace(location.protocol + '//' + location.hostname +\n            (location.port ? ':' + location.port : '') + repo + '/?' +\n            (location.pathname ? 'p=' + location.pathname.replace(/&/g, '~and~').replace(repo, '') : '') +\n            (location.search ? '&q=' + location.search.slice(1).replace(/&/g, '~and~') : '') +\n            (location.hash));\n    };\n    const resolve = () => {\n        if (location.search) {\n            const query = location.search.slice(1).split('&')\n                .reduce((query, parameter) => {\n                const splitted = parameter.split('=');\n                return Object.assign(Object.assign({}, query), { [splitted[0]]: splitted.slice(1).join('=').replace(/~and~/g, '&') });\n            }, {});\n            if (query.p !== undefined) {\n                window.history.replaceState(null, null, repo + (query.p || '') +\n                    (query.q ? ('?' + query.q) : '') +\n                    location.hash);\n            }\n        }\n    };\n    document.title === '404' ? redirect() : resolve();\n})(window.location, false);\n\n\n//# sourceURL=webpack://hypeguardian-landing/./src/client/404.tsx?")})();